g/.\";'),(_binary 'en',_binary 'messages:api-credits-header',_binary 's:7:\"Credits\";'),(_binary 'en',_binary 'messages:api-error-badtoken',_binary 's:26:\"Internal error: Bad token.\";'),(_binary 'en',_binary 'messages:api-error-emptypage',_binary 's:41:\"Creating new, empty pages is not allowed.\";'),(_binary 'en',_binary 'messages:api-error-publishfailed',_binary 's:56:\"Internal error: Server failed to publish temporary file.\";'),(_binary 'en',_binary 'messages:api-error-stashfailed',_binary 's:54:\"Internal error: Server failed to store temporary file.\";'),(_binary 'en',_binary 'messages:api-error-unknown-warning',_binary 's:22:\"Unknown warning: \"$1\".\";'),(_binary 'en',_binary 'messages:api-error-unknownerror',_binary 's:20:\"Unknown error: \"$1\".\";'),(_binary 'en',_binary 'messages:api-exception-trace',_binary 's:15:\"$1 at $2($3)\n$4\";'),(_binary 'en',_binary 'messages:api-feed-error-title',_binary 's:10:\"Error ($1)\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-header',_binary 's:391:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-header-hyperlinked',_binary 's:377:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-header-only-html',_binary 's:219:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-status',_binary 's:55:\"This response would be returned with HTTP status $1 $2.\";'),(_binary 'en',_binary 'messages:api-format-title',_binary 's:20:\"MediaWiki API result\";'),(_binary 'en',_binary 'messages:api-help-authmanager-general-usage',_binary 's:1251:\"The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-additional-params',_binary 's:341:\"This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-continue',_binary 's:149:\"This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-mergerequestfields',_binary 's:71:\"Merge field information for all authentication requests into one array.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-messageformat',_binary 's:37:\"Format to use for returning messages.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-preservestate',_binary 's:65:\"Preserve state from a previous failed login attempt, if possible.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-request',_binary 's:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-requests',_binary 's:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-returnurl',_binary 's:514:\"Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),(_binary 'en',_binary 'messages:api-help-datatypes',_binary 's:1234:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nSome parameter types in API requests need further explanation:\n;boolean\n:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\n;timestamp\n:Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\n;alternative multiple-value separator\n:Parameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\";'),(_binary 'en',_binary 'messages:api-help-datatypes-header',_binary 's:10:\"Data types\";'),(_binary 'en',_binary 'messages:api-help-examples',_binary 's:31:\"{{PLURAL:$1|Example|Examples}}:\";'),(_binary 'en',_binary 'messages:api-help-flag-deprecated',_binary 's:26:\"This module is deprecated.\";'),(_binary 'en',_binary 'messages:api-help-flag-generator',_binary 's:39:\"This module can be used as a generator.\";'),(_binary 'en',_binary 'messages:api-help-flag-internal',_binary 's:9