on',_binary 's:140:\"Note that the HTTP POST must be done as a file upload (i.e. using multipart/form-data) when sending a file for the <var>xml</var> parameter.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-assignknownusers',_binary 's:64:\"Assign edits to local users where the named user exists locally.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-fullhistory',_binary 's:77:\"For interwiki imports: import the full history, not just the current version.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-interwikipage',_binary 's:38:\"For interwiki imports: page to import.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-interwikiprefix',_binary 's:128:\"For uploaded imports: interwiki prefix to apply to unknown user names (and known users if <var>$1assignknownusers</var> is set).\";'),(_binary 'en',_binary 'messages:apihelp-import-param-interwikisource',_binary 's:43:\"For interwiki imports: wiki to import from.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-namespace',_binary 's:77:\"Import to this namespace. Cannot be used together with <var>$1rootpage</var>.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-rootpage',_binary 's:84:\"Import as subpage of this page. Cannot be used together with <var>$1namespace</var>.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-summary',_binary 's:25:\"Log entry import summary.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-tags',_binary 's:99:\"Change tags to apply to the entry in the import log and to the null revision on the imported pages.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-templates',_binary 's:61:\"For interwiki imports: import all included templates as well.\";'),(_binary 'en',_binary 'messages:apihelp-import-param-xml',_binary 's:18:\"Uploaded XML file.\";'),(_binary 'en',_binary 'messages:apihelp-import-summary',_binary 's:53:\"Import a page from another wiki, or from an XML file.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-ascii',_binary 's:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-callback',_binary 's:113:\"If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-formatversion',_binary 's:218:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Modern format.\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-utf8',_binary 's:190:\"If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-json-summary',_binary 's:27:\"Output data in JSON format.\";'),(_binary 'en',_binary 'messages:apihelp-jsonfm-summary',_binary 's:50:\"Output data in JSON format (pretty-print in HTML).\";'),(_binary 'en',_binary 'messages:apihelp-link',_binary 's:25:\"[[Special:ApiHelp/$1|$2]]\";'),(_binary 'en',_binary 'messages:apihelp-linkaccount-example-link',_binary 's:67:\"Start the process of linking to an account from <kbd>Example</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-linkaccount-summary',_binary 's:64:\"Link an account from a third-party provider to the current user.\";'),(_binary 'en',_binary 'messages:apihelp-login-example-login',_binary 's:7:\"Log in.\";'),(_binary 'en',_binary 'messages:apihelp-login-extended-description',_binary 's:253:\"This action should only be used in combination with [[Special:BotPasswords]]; use for main-account login is deprecated and may fail without warning. To safely log in to the main account, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-login-extended-description-nobotpasswords',_binary 's:140:\"This action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-login-param-domain',_binary 's:18:\"Domain (optional).\";'),(_binary 'en',_binary 'messages:apihelp-login-param-name',_binary 's:10:\"User name.\";'),(_binary 'en',_binary 'messages:apihelp-login-param-password',_binary 's:9:\"Password.\";'),(_binary 'en',_binary 'messages:apihelp-login-param-token',_binary 's:38:\"Login token obtained in first request.\";'),(_binary 'en',_binary 'messages:apihelp-login-summary',_binary 's:38:\"Log in and get authentication cookies.\";'),(_binary 'en',_binary 'messages:apihelp-logout-example-logout',_binary 's:25:\"Log the current user out.\";'),(_binary 'en',_binary 'messages:apihelp-logout-summary',_binary 's:31:\"Log out and clear session data.\";'),(_binary 'en',_binary 'messages:apihelp-main-extended-description',_binary 's:1202:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentation]]\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailing list]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API Announcements]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]\n</div>\n<strong>Status:</strong> The MediaWiki API is a mature and stable interface that is actively supported and improved. While we try to avoid it, we may occasionally need to make breaking changes; subscribe to [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ the mediawiki-api-announce mailing list] for notice of updates.\n\n<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key \"MediaWiki-API-Error\" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testing:</strong> For ease of testing API requests, see [[Special:ApiSandbox]].</p>\";'),(_binary 'en',_binary 'messages:apihelp-main-param-action',_binary 's:24:\"Which action to perform.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-assert',_binary 's:100:\"Verify the user is logged in if set to <kbd>user</kbd>, or has the bot user right if <kbd>bot</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-assertuser',_binary 's:42:\"Verify the current user is the named user.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-curtimestamp',_binary 's:44:\"Include the current timestamp in the result.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-errorformat',_binary 's:349:\"Format to use for warning and error text output.\n; plaintext: Wikitext with HTML tags removed and entities replaced.\n; wikitext: Unparsed wikitext.\n; html: HTML.\n; raw: Message key and parameters.\n; none: No text output, only the error codes.\n; bc: Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-errorlang',_binary 's:336:\"Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>content</kbd> to use this wiki\'s content language, or specify <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-errorsuselocal',_binary 's:95:\"If given, error texts will use locally-customized messages from the {{ns:MediaWiki}} namespace.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-format',_binary 's:25:\"The format of the output.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-maxage',_binary 's:101:\"Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-maxlag',_binary 's:488:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-origin',_binary 's:1009:\"When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nFor authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is whitelisted, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.\n\nFor non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-requestid',_binary 's:91:\"Any value given here will be included in the response. May be used to distinguish requests.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-responselanginfo',_binary 's:89:\"Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-servedby',_binary 's:60:\"Include the hostname that served the request in the results.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-smaxage',_binary 's:102:\"Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-uselang',_binary 's:322:\"Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>user</kbd> to use the current user\'s language preference, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),(_binary 'en',_binary 'messages:apihelp-main-summary',_binary 's:0:\"\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-activate',_binary 's:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-create',_binary 's:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-deactivate',_binary 's:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-delete',_binary 's:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-ignorewarnings',_binary 's:68:\"Whether to ignore any warnings that are issued during the operation.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-operation',_binary 's:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-reason',_binary 's:78:\"An optional reason for creating, deleting, activating or deactivating the tag.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-tag',_binary 's:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-tags',_binary 's:60:\"Change tags to apply to the entry in the tag management log.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-summary',_binary 's:49:\"Perform management tasks relating to change tags.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-example-merge',_binary 's:71:\"Merge the entire history of <kbd>Oldpage</kbd> into <kbd>Newpage</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-example-merge-timestamp',_binary 's:116:\"Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-from',_binary 's:102:\"Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-fromid',_binary 's:102:\"Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-reason',_binary 's:29:\"Reason for the history merge.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-timestamp',_binary 's:208:\"Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-to',_binary 's:98:\"Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-toid',_binary 's:98:\"Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-summary',_binary 's:21:\"Merge page histories.\";'),(_binary 'en',_binary 'messages:apihelp-move-example-move',_binary 's:76:\"Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-from',_binary 's:78:\"Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-fromid',_binary 's:78:\"Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-ignorewarnings',_binary 's:20:\"Ignore any warnings.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-movesubpages',_binary 's:31:\"Rename subpages, if applicable.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-movetalk',_binary 's:35:\"Rename the talk page, if it exists.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-noredirect',_binary 's:24:\"Don\'t create a redirect.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-reason',_binary 's:22:\"Reason for the rename.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-tags',_binary 's:99:\"Change tags to apply to the entry in the move log and to the null revision on the destination page.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-to',_binary 's:28:\"Title to rename the page to.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-unwatch',_binary 's:67:\"Remove the page and the redirect from the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-watch',_binary 's:62:\"Add the page and the redirect to the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-watchlist',_binary 's:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),(_binary 'en',_binary 'messages:apihelp-move-summary',_binary 's:12:\"Move a page.\";'),(_binary 'en',_binary 'messages:apihelp-no-such-module',_binary 's:22:\"Module \"$1\" not found.\";'),(_binary 'en',_binary 'messages:apihelp-none-summary',_binary 's:15:\"Output nothing.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-example-te',_binary 's:40:\"Find pages beginning with <kbd>Te</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-format',_binary 's:25:\"The format of the output.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-limit',_binary 's:36:\"Maximum number of results to return.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-namespace',_binary 's:90:\"Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-redirects',_binary 's:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-search',_binary 's:14:\"Search string.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-suggest',_binary 's:121:\"Do nothing if <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> is false.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-warningsaserror',_binary 's:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-summary',_binary 's:46:\"Search the wiki using the OpenSearch protocol.\";'),(_binary 'en',_binary 'messages:apihelp-options-example-change',_binary 's:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),(_binary 'en',_binary 'messages:apihelp-options-example-complex',_binary 's:72:\"Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-options-example-reset',_binary 's:22:\"Reset all preferences.\";'),(_binary 'en',_binary 'messages:apihelp-options-extended-description',_binary 's:183:\"Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-change',_binary 's:358:\"List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-optionname',_binary 's:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-optionvalue',_binary 's:62:\"The value for the option specified by <var>$1optionname</var>.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-reset',_binary 's:40:\"Resets preferences to the site defaults.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-resetkinds',_binary 's:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),(_binary 'en',_binary 'messages:apihelp-options-summary',_binary 's:39:\"Change preferences of the current user.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-example-1',_binary 's:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-example-2',_binary 's:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-formatmodules',_binary 's:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-helpformat',_binary 's:23:\"Format of help strings.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-mainmodule',_binary 's:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-modules',_binary 's:241:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-pagesetmodule',_binary 's:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-querymodules',_binary 's:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-summary',_binary 's:37:\"Obtain information about API modules.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-page',_binary 's:13:\"Parse a page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-summary',_binary 's:16:\"Parse a summary.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-text',_binary 's:15:\"Parse wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-texttitle',_binary 's:42:\"Parse wikitext, specifying the page title.\";'),(_binary 'en',_binary 'messages:apihelp-parse-extended-description',_binary 's:500:\"See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-contentformat',_binary 's:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-contentmodel',_binary 's:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disableeditsection',_binary 's:47:\"Omit edit section links from the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disablelimitreport',_binary 's:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disablepp',_binary 's:44:\"Use <var>$1disablelimitreport</var> instead.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disablestylededuplication',_binary 's:59:\"Do not deduplicate inline stylesheets in the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disabletidy',_binary 's:57:\"Do not run HTML cleanup (e.g. tidy) on the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disabletoc',_binary 's:33:\"Omit table of contents in output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-effectivelanglinks',_binary 's:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-generatexml',_binary 's:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-oldid',_binary 's:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-onlypst',_binary 's:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-page',_binary 's:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-pageid',_binary 's:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-preview',_binary 's:22:\"Parse in preview mode.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-prop',_binary 's:35:\"Which pieces of information to get:\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-pst',_binary 's:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),(_binary 'en',_binary 'messages: