ategories in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-categorieshtml',_binary 's:41:\"Gives the HTML version of the categories.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-displaytitle',_binary 's:38:\"Adds the title of the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars',_binary 's:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-externallinks',_binary 's:48:\"Gives the external links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-headhtml',_binary 's:141:\"Gives parsed doctype, opening <code>&lt;html&gt;</code>, <code>&lt;head&gt;</code> element and opening <code>&lt;body&gt;</code> of the page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-headitems',_binary 's:64:\"Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-images',_binary 's:40:\"Gives the images in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-indicators',_binary 's:58:\"Gives the HTML of page status indicators used on the page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-iwlinks',_binary 's:45:\"Gives interwiki links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-jsconfigvars',_binary 's:110:\"Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-langlinks',_binary 's:48:\"Gives the language links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-limitreportdata',_binary 's:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-limitreporthtml',_binary 's:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-links',_binary 's:48:\"Gives the internal links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-modules',_binary 's:211:\"Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsetree',_binary 's:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsewarnings',_binary 's:55:\"Gives the warnings that occurred while parsing content.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-properties',_binary 's:56:\"Gives various properties defined in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-revid',_binary 's:40:\"Adds the revision ID of the parsed page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-sections',_binary 's:42:\"Gives the sections in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-templates',_binary 's:43:\"Gives the templates in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-text',_binary 's:38:\"Gives the parsed text of the wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-wikitext',_binary 's:44:\"Gives the original wikitext that was parsed.\";'),(_binary 'en',_binary 'messages:apihelp-parse-summary',_binary 's:41:\"Parses content and returns parser output.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-example-rcid',_binary 's:23:\"Patrol a recent change.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-example-revid',_binary 's:18:\"Patrol a revision.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-param-rcid',_binary 's:27:\"Recentchanges ID to patrol.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-param-revid',_binary 's:22:\"Revision ID to patrol.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-param-tags',_binary 's:52:\"Change tags to apply to the entry in the patrol log.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-summary',_binary 's:26:\"Patrol a page or revision.\";'),(_binary 'en',_binary 'messages:apihelp-php-param-formatversion',_binary 's:218:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Modern format.\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),(_binary 'en',_binary 'messages:apihelp-php-summary',_binary 's:37:\"Output data in serialized PHP format.\";'),(_binary 'en',_binary 'messages:apihelp-phpfm-summary',_binary 's:60:\"Output data in serialized PHP format (pretty-print in HTML).\";'),(_binary 'en',_binary 'messages:apihelp-protect-example-protect',_binary 's:15:\"Protect a page.\";'),(_binary 'en',_binary 'messages:apihelp-protect-example-unprotect',_binary 's:105:\"Unprotect a page by setting restrictions to <kbd>all</kbd> (i.e. everyone is allowed to take the action).\";'),(_binary 'en',_binary 'messages:apihelp-protect-example-unprotect2',_binary 's:44:\"Unprotect a page by setting no restrictions.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-cascade',_binary 's:160:\"Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-expiry',_binary 's:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections.