s',_binary 's:140:\"Find missing entities in Elasticsearch (only for installations that use the <code>ElasticStore</code>) and schedule appropriate update jobs.\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-description-rebuildfulltextsearchtable',_binary 's:111:\"Rebuilds the <code>SQLStore</code> fulltext search index (for installations where the setting has been enabled.\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-description-rebuildpropertystatistics',_binary 's:56:\"Rebuilds the usage statistics for all property entities.\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-description-removeduplicateentities',_binary 's:83:\"Removes duplicate entities found in selected tables that have no active references.\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-description-setupstore',_binary 's:71:\"Sets up the storage backend selected in <code>LocalSettings.php</code>.\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-description-updateentitycollation',_binary 's:191:\"Updates the <code>smw_sort</code> field in the <code>SQLStore</code> (in accordance with the [https://www.semantic-mediawiki.org/wiki/Help:$smwgEntityCollation $smwgEntityCollation] setting).\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-description-updatequerydependencies',_binary 's:179:\"Update queries and query dependencies (see the [https://www.semantic-mediawiki.org/wiki/Help:$smwgEnabledQueryDependencyLinksStore $smwgEnabledQueryDependencyLinksStore] setting).\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-section-intro',_binary 's:127:\"The following maintenance scripts require an administrator and access to the command line to be able to execute listed scripts.\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-section-rebuild',_binary 's:15:\"Rebuild scripts\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-section-title',_binary 's:37:\"List of available maintenance scripts\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-script-section-update',_binary 's:14:\"Update scripts\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-tab-scripts',_binary 's:19:\"Maintenance scripts\";'),(_binary 'en',_binary 'messages:smw-admin-maintenance-tab-tasks',_binary 's:5:\"Tasks\";'),(_binary 'en',_binary 'messages:smw-admin-objectid',_binary 's:3:\"ID:\";'),(_binary 'en',_binary 'messages:smw-admin-operational-statistics',_binary 's:194:\"This page contains operational statistics collected in or from Semantic MediaWiki related functions. An extended list of wiki specific statistics can be found [[Special:Statistics|<b>here</b>]].\";'),(_binary 'en',_binary 'messages:smw-admin-other-functions',_binary 's:15:\"Other functions\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-active',_binary 's:53:\"An outdated entities disposal job has been scheduled.\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-button',_binary 's:17:\"Schedule disposal\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-intro',_binary 's:279:\"Some activities (a change to a property type, the removal of wikipages, or the correction of error values) will result in [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and it is suggested to remove them periodically to free associated table space.\";'),(_binary 'en',_binary 'messages:smw-admin-outdateddisposal-title',_binary 's:26:\"Outdated entities disposal\";'),(_binary 'en',_binary 'messages:smw-admin-permission-missing',_binary 's:210:\"The access to this page has been blocked due to missing permissions, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Permissions permissions] help page for details about the necessary settings.\";'),(_binary 'en',_binary 'messages:smw-admin-permissionswarn',_binary 's:432:\"If the operation fails with SQL errors, the database user employed by your wiki (check