atistics\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-extra',_binary 's:19:\"Statistic functions\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-job-docu',_binary 's:288:\"The job statistics displays information about scheduled Semantic MediaWiki jobs that have not yet been executed. The number of jobs may be slightly inaccurate or contains failed attempts, please consult the [https://www.mediawiki.org/wiki/Manual:Job_queue manual] for further information.\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-job-title',_binary 's:14:\"Job statistics\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-querycache-disabled',_binary 's:141:\"The [https://www.semantic-mediawiki.org/wiki/QueryCache QueryCache] has not been enabled on this wiki and hereby no statistics are available.\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-querycache-legend',_binary 's:869:\"The cache statistics is to contain provisional cumulative as well as derived data including: \n* \"misses\" as the total attempts to retrieve data from the cache with unattainable responses, forcing a direct repository (DB, triple-store etc.) retrieval \n* \"deletes\" as the total amount of cache eviction operations (either through a purge or query dependency) \n* \"hits\" contains the amount of cache retrievals from either embedded (queries called from within a wiki page) or non-embedded (if enabled, requested by pages like Special:Ask or the API) sources \n* \"medianRetrievalResponseTime\" is an orientation value of the median response time (in sec.) for cached and non-cached retrieval requests over the time span of the collection process  \n* \"noCache\" indicates the amount of no attempt requests (limit=0 queries, \'no-cache\' option etc.) to retrieve results from cache\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-querycache-title',_binary 's:11:\"Query cache\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-section-explain',_binary 's:62:\"The section provides additional statistics for administrators.\";'),(_binary 'en',_binary 'messages:smw-admin-statistics-semanticdata-overview',_binary 's:8:\"Overview\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-docu',_binary 's:298:\"This page lists entries from selected tables that have been categorized as [https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities duplicates]. Duplicate entries should (if at all) only occur on rare occasions potentially caused by a terminated update or unsuccessful rollback transaction.\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-helplink',_binary 's:63:\"https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-intro',_binary 's:91:\"<u>$1</u> to find entities that are categorized as duplicates for the selected table matrix\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-duplookup-title',_binary 's:25:\"Duplicate entities lookup\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-docu',_binary 's:256:\"This page contains information about settings, mappings, health, and index statistics related to an Elasticsearch cluster that is connected to Semantic MediaWiki and its [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore <code>ElasticStore</code>].\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-endpoints',_binary 's:9:\"Endpoints\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-functions',_binary 's:19:\"Supported functions\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-indices-intro',_binary 's:72:\"<u>$1</u> provides an overview of available indices and their statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-indices-title',_binary 's:7:\"Indices\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-intro',_binary 's:59:\"<u>$1</u> shows details about settings and index statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-docu',_binary 's:240:\"This page contains field mapping details used by the current index. It is recommended to monitor the mappings in connection with the <code>index.mapping.total_fields.limit</code> (specifies the maximum number of fields in an index allowed).\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-docu-extra',_binary 's:237:\"The <code>property_fields</code> refers to the count of indexed core fields while the <code>nested_fields</code> refers to an accumulated count of additional fields assigned to a core field to support specific structured search patterns.\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-fields',_binary 's:14:\"Field mappings\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-intro',_binary 's:44:\"<u>$1</u> to list indices and field mappings\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-summary',_binary 's:7:\"Summary\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-mappings-title',_binary 's:8:\"Mappings\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-no-connection',_binary 's:216:\"The wiki is currently \'\'\'unable\'\'\' to establish a connection to the Elasticsearch cluster, please contact the wiki administrator to investigate the issue as it incapacitates the index and query ability of the system.\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-nodes-intro',_binary 's:31:\"<u>$1</u> shows node statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-nodes-title',_binary 's:5:\"Nodes\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-replication-docu',_binary 's:324:\"This page provides information about the [https://www.semantic-mediawiki.org/wiki/Help:Replication_monitoring replication status] of entities 