inary 'messages:smw-admin-supplementary-elastic-statistics-intro',_binary 's:38:\"<u>$1</u> shows index level statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-statistics-title',_binary 's:10:\"Statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-file-ingest-job-count',_binary 's:42:\"Injest (file) job backlog: $1 (estimation)\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-last-active-replication',_binary 's:27:\"Last active replication: $1\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-rebuild-lock',_binary 's:44:\"Replication locked: $1 (rebuild in-progress)\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-recovery-job-count',_binary 's:37:\"Recovery job backlog: $1 (estimation)\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-refresh-interval',_binary 's:20:\"Refresh interval: $1\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-replication',_binary 's:18:\"Replication status\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-status-replication-monitoring',_binary 's:35:\"Replication monitoring (active): $1\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-elastic-title',_binary 's:13:\"Elasticsearch\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-idlookup-intro',_binary 's:36:\"Supports a simple <u>$1</u> function\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-idlookup-short-title',_binary 's:26:\"entity lookup and disposal\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-idlookup-title',_binary 's:26:\"Entity lookup and disposal\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-statistics-cache-intro',_binary 's:58:\"<u>$1</u> shows a selected set of cache related statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-statistics-cache-title',_binary 's:16:\"Cache statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-statistics-intro',_binary 's:37:\"Displays an extended set of <u>$1</u>\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-statistics-short-title',_binary 's:22:\"operational statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-statistics-title',_binary 's:22:\"Operational statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-explain',_binary 's:172:\"This section contains selected table statistics to help administrators and data curators to make informed decisions about that state of the back-end and the storage engine.\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-intro',_binary 's:48:\"Generates <u>$1</u> for a selected set of tables\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-legend',_binary 's:81:\"The legend describes some of the keys used for the table statistics and includes:\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-legend-blob-table',_binary 's:394:\"\n* <code>unique_terms_occurrence_in_percent</code> percentange of terms that are unique (a low percentange rate indicates that repetitve terms occupy the table content and index) \n* <code>rows.terms_occurrence.single_occurrence_total_count</code> number of terms that only appear once \n* <code>rows.terms_occurrence.multi_occurrence_total_count</code> number of terms that appear more than once\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-legend-general',_binary 's:63:\"\n* <code>total_row_count</code> total number of rows in a table\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-legend-id-table',_binary 's:693:\"\n* <code>last_id</code> last ID currently in use \n* <code>duplicate_count</code> number of duplicates found in the id_table (see also [[Special:SemanticMediaWiki/duplicate-lookup|Duplicate entities lookup]]) \n* <code>rows.rev_count</code> number of rows that have a revision_id assigned indicating a direct wikipage link \n* <code>rows.smw_namespace_group_by_count</code> numbers of aggregated rows for namespaces used in the table \n* <code>rows.smw_proptable_hash.query_match_count</code> number of query subobjects with a corresponding table reference \n* <code>rows.smw_proptable_hash.query_null_count</code> number of query subobjects without a table reference (unlinked, floating reference)\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-short-title',_binary 's:16:\"table statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-operational-table-statistics-title',_binary 's:16:\"Table statistics\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-section-intro',_binary 's:333:\"This section provides additional functions beyond the scope of maintenance activities and it is possible that some functions which are listed (see the [https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki/Supplementary_functions documentation]) are restricted or unavailable and therefore inaccessible on this wiki.\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-section-subtitle',_binary 's:24:\"Supported core functions\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-section-title',_binary 's:23:\"Supplementary functions\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-settings-intro',_binary 's:51:\"<u>$1</u> lists settings used in Semantic MediaWiki\";'),(_binary 'en',_binary 'messages:smw-admin-supplementary-settings-title',_binary 's:22:\"Configuration settings\";'),(_binary 'en',_binary 'messages:smw-admin-support',_binary 's:15:\"Getting support\";'),(_binary 'en',_binary 'messages:smw-admin-supportdocu',_binary 's:63:\"Various resources are p