properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pvali',_binary 's:330:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value_list \"$1\"] is a predefined property that can specify a reference to a list that holds permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pvap',_binary 's:292:\"\"$1\" is a predefined property that can specify a [[MediaWiki:Smw allows pattern|pattern reference]] to apply [https://en.wikipedia.org/wiki/Regular_expression regular expression] matching and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-pvuc',_binary 's:205:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to restrict value assignments for each instance to be unique (or one at most).\";'),(_binary 'en',_binary 'messages:smw-property-predefined-qty',_binary 's:192:\"\"$1\" is a [[Special:Types/Quantity|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent quantity values.\";'),(_binary 'en',_binary 'messages:smw-property-predefined-schema-def',_binary 's:165:\"\"$1\" is a predefined property that stores the schema content and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-schema-desc',_binary 's:167:\"\"$1\" is a predefined property that stores a schema description and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),(_binary 'en',_binary 'messages:smw-property-predefined-schema-tag',_binary '