d conditions\n\n*[https://www.semantic-mediawiki.org/wiki/Help:Search_operators Search operators] lists available search operators including those for range and wildcard queries\";'),(_binary 'en',_binary 'messages:smw-search-help-input-assistance',_binary 's:356:\"[https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Input assistance] is provided for the input field and requires to use one of following prefixes:\n\n*<code>p:</code> to enable property suggestions (e.g. <code><nowiki>[[p:Has ...</nowiki></code>)\n\n*<code>c:</code> to enable category suggestions\n\n*<code>con:</code> to enable concept suggestions\";'),(_binary 'en',_binary 'messages:smw-search-help-intro',_binary 's:317:\"A <code><nowiki>[[ ... ]]</nowiki></code> input will signal to the input processor to use the Semantic MediaWiki search back-end. It should be noted that combining <code><nowiki>[[ ... ]]</nowiki></code> with an unstructured text search such as <code><nowiki>[[ ... ]] OR Lorem ipsum</nowiki></code> is not supported.\";'),(_binary 'en',_binary 'messages:smw-search-help-proximity',_binary 's:344:\"Proximity searches (a property being unknown, \'\'\'only\'\'\' available for those back-ends that provide a full-text search integration):\n\n*<code><nowiki>[[in:lorem ipsum]]</nowiki></code> (search in all documents for \"lorem\" and \"ipsum\" that have been indexed)\n\n* <code><nowiki>[[phrase:lorem ipsum]]</nowiki></code> (match \"lorem ipsum\" as phrase)\";'),(_binary 'en',_binary 'messages:smw-search-help-structured',_binary 's:365:\"Structured searches:\n\n*<code><nowiki>[[Category:Lorem ipsum]]</nowiki></code>, <code><nowiki>[[Has number::123]]</nowiki></code> (as [https://www.semantic-mediawiki.org/wiki/Help:Search#Filter_context filtered context])\n\n*<code><nowiki>[[Has text::~*lorem*]]</nowiki></code> (with a [https://www.semantic-mediawiki.org/wiki/Help:Search#Query_context query context])\";'),(_binary 'en',_binary 'messages:smw-search-hide',_binary 's:4:\"Hide\";'),(_binary 'en',_binary 'messages:smw-search-input',_binary 's:16:\"Input and search\";'),(_binary 'en',_binary 'messages:smw-search-input-assistance',_binary 's:165:\"The [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance input assistant] is also enabled to ease the pre-selection of available properties and categories.\";'),(_binary 'en',_binary 'messages:smw-search-profile',_binary 's:8:\"Extended\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-find-forms',_binary 's:15:\"available forms\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-form',_binary 's:213:\"Forms are provided (if maintained) to match specific use cases by exposing different property and value fields to narrow down the input process and make it easy for users to proceed with a search request. (see $1)\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-intro',_binary 's:209:\"The Special:Search [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch/Extended_profile extended profile] provides access to search functions specific to Semantic MediaWiki and its supported query backend.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-namespace',_binary 's:137:\"The namespace selection box will be hidden as soon as a form is selected but can be made visible with the help of the \"show/hide\" button.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-query',_binary 's:47:\"Used <code><nowiki>$1</nowiki></code> as query.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-query-link',_binary 's:36:\"For more details, please use the $1.\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax',_binary 's:155:\"The search input field supports the use of the <code>#ask</code> syntax to define a Semantic MediaWiki specific search context. Useful expressions include:\";'),(_binary 'en',_binary 'messages:smw-search-profile-extended-help-search-syntax-note',_bi